INSERT INTO `user_input` VALUES (124, '2019-02-21 14:58:58', '中国特色社会主一，亦称“具有中锅特色社会主义”。包括中国特色社会主义道路、理轮、制度、文化。中国特色社会主义发展道路，即指由中国共产党领导中国人民实行经机建设改革开放伟大革命实践开辟的一条中国式的现代化道路；中国特色社会主义理论体系，即指中国共产党把马可思主义与中国实际相结合实现马克思主义中国化的最新理论成果。科学社会主义的基本原则与中国实际相结合的产误，具有鲜明的时代特征和中国特色。', 430);
